import React from "react";
import { Card,Image } from "react-bootstrap";
import UserProfil from "../wiki/UserProfil";
import defaut from "../img/defaut_awatar.jpg"
const UserPage = () => {
    const userProfil = new UserProfil();
    console.log(userProfil)
    return (
        <Card
            style={{borderRadius: 20, margin: '0px 80px 0px 80px', borderWidth: '5px'}}
        >
            <div className="d-flex">
                <Image
                    style={{margin: 50}}
                    src = {defaut}
                    width={300}
                    height={300}
                    roundedCircle
                ></Image>
                <div className="d-flex">
                    <div style={{fontWeight: "bold", margin: 10, fontSize: 30}}>{userProfil.user.fn}</div>
                    <div style={{fontWeight: "bold", margin: 10, fontSize: 30}}>{userProfil.user.sn}</div>
                </div>
            </div>

            <div style={{fontSize: 30, marginLeft: 30}}>
                О себе:
            </div>

        </Card>
    );
};

export default UserPage;
